import React, { Component } from 'react';




class Login extends Component {
    render() {
      return (
        <div className="welcomeLogin">
            <h2>Welcome to our app.</h2>
            <p>Please login with your personal identification.</p>
        </div>
      );
    }
  }

  export default Login;
